import java.math.BigInteger;
public class FibonacciExample{
public static void main(String args[]){
int fibSequenceNum = 107;
int n = fibSequenceNum/2;
BigInteger[] fib = {BigInteger.valueOf(0),BigInteger.valueOf(1)};
for(int i = 0; i < n; i++) {
    fib[0] = fib[0].add(fib[1]);
    fib[1] = fib[0].add(fib[1]);
}
System.out.println(fib[fibSequenceNum%2]);
}}

I wrote a function using this in C# and the time taken to run it was almost a fraction of what it would have taken.  Here is the function:

static long Fib2(int n)
        {
            if (_memo.ContainsKey(n))
                return _memo[n];

            var value = Fib2(n - 1) + Fib2(n - 2);

            _memo[n] = value;

            return value;
        }

The function that we normally use is this:

static long Fib(int n)
        {
            if (n < 2) return n;

            return Fib(n - 1) + Fib(n - 2);
        }

