Yes, you can solve the recursion a[n] = a[n-1] + a[n-2] . Indeed, 
def fib(n): 
    return round(1/(5**(1/2)) *((1+5**(1/2))/2)**n - 1/(5**(1/2))* ((1-5**(1/2))/2)**n)

is the program you have in mind. But you need to take the power to the n, so that would be O(log (n)) time when n is too large.

