And you can solve it recursively upwards (i.e. in Scala:)
<code>
scala> def fib (n: Int) : Int = {
     |   def fib (lower: Int, upper: Int, step: Int): Int = {
     |     if (step == n) upper else
     |     fib (upper, lower+upper, step+1) }
     |   fib (0, 1, 0)
     | }
fib: (n: Int)Int
</code>

If you're confused by nested functions, just move the inner one outside, but then you have to pass n additionally.

